window.bookSummaryJSON = "<p>Sean was just waiting for his best friend to show up at the bar so they could play some pool. It came as a shock when the tall blonde man accosted Sean and demanded that he change seats. His refusal would change his life.</p> <p>When the fight ended, Sean found himself in the strangest meeting of his life. Odin, Archangel Michael, Lucifer, and Morrigan all vied for his soul, each offering different deals. Sean had to choose, so he chose to go with the goddess of Fate, Death, and Battle.</p> <p>Placed on a new world, gifted with a new body crafted by the gods, and more gifts from other deities of the Tuatha De Danann, Sean now has the chance to live out a new life on a new world. Not everything will be sunshine and roses, however, in this world ruled by the Summer and Winter Queens. He learns quickly that words have power in this world, and that Agreements are binding.&nbsp;</p> <p>Sean has his work cut out for finding his place in this new world.</p>"; 
